Text:
@chumzy -- Maybe they aren't uploading at a speed that would satisfy you, but no matter what it is, it's none of your business.  People have lives.  Things happen.  Just be thankful that they *do* upload these things with such high quality, and *you* get to download them for free and with such little effort.

If you were merely asking out of curiosity, rather than scolding, then you need to learn how to write better, because that was just plain rude.

@EZTV - Thanks as always, you guys.  I really appreciate *how quickly* you get things out, but even when it's "slow" (and that's got to be a relative comparison) Ill wait to get your stuff rather than rush out and grab the first stuff out there.
